@elleusa Name: Misty Copeland

Bonafides: Soloist: American Ballet Theater

Beloved Item: Invisible Louboutins “I feel like most ballet dancers, we’re just so completely aware of our bodies and everybody wears things that flatter our bodies the most, so I think that that always plays a role when we step outside the studio. I’m constantly thinking of ways to make myself look longer and leaner and tall. And if I can, if my body is not too exhausted, I’m almost always in heels. Back before Louboutin made my skin colored shoes, it was hard; I think I was always searching for that perfect color that made it look like I wasn’t wearing anything. But now I have a Christian Louboutin shoe—just the classic, shiny, patent, nude heels—the color and everything is perfect for my skin, and those are kind of like my go-to heels. I don’t think every dancer would agree with me that they would be in heels when they’re not on stage, but I think that the shape of my foot, the way my arch is, it’s just comfortable for me.” —As told to Keziah Weir

